import Link from 'next/link';
import {Header} from 'react-awesome-slider';

const PageHeader = () => {
  return (
      <Header>
        <nav>
          <Link href="page-one"><a>Page One</a></Link>
          <Link href="page-two"><a>Page Two</a></Link>
        </nav>
      </Header>
  )
}

export default PageHeader;
